import React from 'react';
import './Navbar.css';
import { NavLink } from 'react-router-dom';



function Navbar() {
    return (
        <header>
            <nav>
                <ul>
                <li><NavLink exact to="/newclient" >Novo Cliente</NavLink></li>
                    <li><NavLink exact to="/newclient" >Novo Cliente</NavLink></li>
                    <li><NavLink exact to="/searchclient" >Procurar Cliente</NavLink></li>

                </ul>
            </nav>
        </header>
    )
}

export default Navbar;
